import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from '../notes'


function App() {
  return (
    <div>
      <Header />
      {notes.map((singleNote) => {

        return (
          <Note
            key={singleNote.id}
            title={singleNote.title}
          />
        )

      })}
      <Footer />
    </div>
  );
}

export default App;
